    false,nt"url": null,nt"notes": "Completion report for the two year Federal
    Aid in Sport Fish Restoration project. This project was created out of the need
    to determine which Sandhill lakes are most likely to produce high-quality panfish.
     This was done by determining the physical, chemical, and biological factors that
    are related to bluegill, black crappie, and yellow perch recruitment, growth, and
    mortality in Sandhill lakes.  This report includes lakes both on and outside of
    the Valentine National Wildlife Refuge. Tables and charts from the statistical analysis
    are included in the appendix.",nt"license_title": "License Not Specified",nt"extras":
